import React from "react";
// import { useState } from "react";
import { Link } from "react-router-dom";
import "./Home.css";
// import img from "../images/425-500.jpg";
import image3201 from "../images/320.jpg"
import image3202 from "../images/320-2.jpg"
import image3203 from "../images/320-3.jpg"
// import image3751 from "../images/375.jpg"
// import image3752 from "../images/375-2.jpg"
// import image3753 from "../images/375-3.jpg"
// import image4251 from "../images/425.jpg"
// import image4252 from "../images/425-3.jpg"
// import image4253 from "../images/425-3.jpg"
import img2 from "../images/lucas-5tRmLGguL3Q-unsplash.jpg";
import logo from "../images/Logo.png";
// import hamburger from "../images/hamburger.png";
<link
  rel="stylesheet"
  href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"
></link>;

function Home() {
  // const [media , setMedia] = useState("")
  var onresize = function (e) {
    //note i need to pass the event as an argument to the function
    //  const screen = e.target.outerWidth;
    // let height = e.target.outerHeight;
    // console.log(width ,"width")
    // console.log(height ,"height")
  };
  window.addEventListener("resize", onresize);
  
  var TxtType = function(el, toRotate, period) {
    this.toRotate = toRotate;
    this.el = el;
    this.loopNum = 0;
    this.period = parseInt(period, 10) || 2000;
    this.txt = '';
    this.tick();
    this.isDeleting = false;
};

TxtType.prototype.tick = function() {
    var i = this.loopNum % this.toRotate.length;
    var fullTxt = this.toRotate[i];

    if (this.isDeleting) {
    this.txt = fullTxt.substring(0, this.txt.length - 1);
    } else {
    this.txt = fullTxt.substring(0, this.txt.length + 1);
    }

    this.el.innerHTML = '<span class="wrap">'+this.txt+'</span>';

    var that = this;
    var delta = 200 - Math.random() * 100;

    if (this.isDeleting) { delta /= 2; }

    if (!this.isDeleting && this.txt === fullTxt) {
    delta = this.period;
    this.isDeleting = true;
    } else if (this.isDeleting && this.txt === '') {
    this.isDeleting = false;
    this.loopNum++;
    delta = 500;
    }

    setTimeout(function() {
    that.tick();
    }, delta);
};

window.onload = function() {
    var elements = document.getElementsByClassName('typewrite');
    for (var i=0; i<elements.length; i++) {
        var toRotate = elements[i].getAttribute('data-type');
        var period = elements[i].getAttribute('data-period');
        if (toRotate) {
          new TxtType(elements[i], JSON.parse(toRotate), period);
        }
    }
    // INJECT CSS
    var css = document.createElement("style");
    css.type = "text/css";
    css.innerHTML = ".typewrite > .wrap { border-right: 0.08em solid #fff}";
    document.body.appendChild(css);
};
  return (
    <div>
      <div>
        <header>
          <nav class="navbarlaptop">
            <img class="Logo" src={logo} alt=""></img>
            <div class="divlinks">
              <ul class="ullinks">
                <li class="Link1">
                  <Link class="Links" to="/">
                    Home
                  </Link>
                </li>
                <li class="Link2">
                  <Link class="Links" to="/aboutus">
                    About us
                  </Link>
                </li>
                <li class="Link3">
                  <Link class="Links" to="/contactus">
                    Contact us
                  </Link>
                </li>
              </ul>
            </div>
          </nav>
        </header>
        <div class="imagecontainermobile">
          <img src={image3201} alt="Avatar" class="imagemobile320" />
          <img src={image3202} alt="Avatar" class="imagemobile320" />
          <img src={image3203} alt="Avatar" class="imagemobile320" />
        </div>
        <div class="imagecontainerlaptop">
          <div class="box1">
            <img src={img2} alt="Avatar" class="imagelaptop1" />
            <div class="box1content1">
              <h1>are you student</h1>
            </div>
          </div>
          <div class="box2">
            <img src={img2} alt="Avatar" class="imagelaptop1" />
            <div class="box2content2">
              <h1>are you student</h1>
            </div>
          </div>
          <div class="box3">
            <img src={img2} alt="Avatar" class="imagelaptop1" />
            <div class="box3content3">
              <h1>are you student</h1>
            </div>
          </div>
        </div>
        <h1>
  <a href="" class="typewrite" data-period="2000" data-type='[ "Hi, Im Si.", "I am Creative.", "I Love Design.", "I Love to Develop." ]'>
    <span class="wrap"></span>
  </a>
</h1>
      </div>
    </div>
  );
}

export default Home;
